import React, { useState } from 'react';
import { Input, Button } from 'antd';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const navigate = useNavigate();

  const handleSearch = () => {
    navigate(`/property-list?search=${searchTerm}`);
  };

  return (
    <div style={{ 
      backgroundImage: 'url(https://izcelikyapi.com/wp-content/uploads/2022/05/iki-katli-celik-ev-modelleri.webp)', 
      height: '100vh', 
      backgroundSize: 'cover', 
      backgroundPosition: 'center', 
      display: 'flex', 
      justifyContent: 'center', 
      alignItems: 'center',
      width: '100vw',
      color: 'white',
      position: 'relative'
    }}>
      <div style={{ textAlign: 'center' }}>
        <h1 style={{ fontSize: '48px', fontWeight: 'bold' }}>Find Your New Home!</h1>
        <Input 
          placeholder="İlan Başlığı Ara" 
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          style={{ width: 300, marginTop: 20 }}
        />
        <Button type="primary" size="large" onClick={handleSearch} style={{ marginLeft: 10, marginTop: 20 }}>
          Search
        </Button>
      </div>
    </div>
  );
};

export default Home;
